    "\n",
    "# Load the CSV file\n",
    "df_2021 = pd.read_csv(\"acs5_2021_tx_tract_data.csv\")\n",
    "df_2023 = pd.read_csv(\"acs5_2023_tx_tract_data.csv\")\n",
    "\n",
    "# Show the first 5 rows\n",
    "print(df_2023.head())"
